/* My Inside Style
   name inside.tensor.ru - accordion christmas
   url  https://userstyles.org/styles/121959/inside-tensor-ru-accordion-christmas
   git  https://github.com/iNovozhilov/InsideTensorUserStyle
*/

@-moz-document domain(inside.tensor.ru) {
   #howEasy, .sideBarBackground {
      background: transparent;
   }
   #sideLeft .sideBarBackground:before {
      background-repeat: no-repeat !important;
      background-position: 50% calc(100% - 56px) !important;
      background-image: url('data:image/png;base64,') !important;
   }
   #logoBlock {
      background-repeat: no-repeat !important;
      background-position: calc(100% - 6px) 50% !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__event.icon-View,
   .accordeonMenu>.navigation-LeftNavigation__eventHandler>.navigation-LeftNavigation__event:hover {
      background-repeat: no-repeat !important;
      background-position: 50% 50% !important;
      height: 16px;
      width: 16px;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__event.icon-View:hover {
      transform: rotate(45deg);
   }
   .navigation-LeftNavigation__event.icon-View:before {
      content: '';
   }
}
